using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;

namespace HackerRankExercises
{
    class Strings_SherlockAndTheValidString
    {
        public static void Strings_SherlockAndTheValidString_Exercise()
        {
            //string s = "";
            string s = "";
            //string s = "aaabbbcccdddd";

            string isValid = IsValid(s.Trim());

            Console.WriteLine("Is the string " + s + " valid? " + isValid);
        }

        private static string IsValid(string s)
        {
            // clean the string from end of line/paragraph chars.
            string cleanString = new string(s.Where(c => !char.IsControl(c)).ToArray());
            //cleanString = cleanString.Replace("\p", "");

            // Create a hashset that will contain the unique characters of the string
            HashSet<char> hs = new HashSet<char>();
            foreach (char c in cleanString)
            {
                hs.Add(c);
            }
            hs.Remove('p');
            hs.Remove('n');

            bool isValid = true;

            int occurrencesForCompare = cleanString.Split(cleanString[0]).Length - 1;

            int occurrences = 0;
            int badness = 0;

            foreach (char c in hs)
            {
                Console.WriteLine(c);
            }

            foreach (char c in hs)
            {
                occurrences = s.Split(c).Length - 1;

                if ( occurrences != occurrencesForCompare )
                {
                    if ( (occurrences > (occurrencesForCompare + 1) ) || (occurrences < (occurrencesForCompare - 1) ))
                    {
                        isValid = false;
                        break;
                    }

                    badness++;
                }

                if (badness > 1)
                {
                    isValid = false;
                }
            }

            return (isValid) ? "YES" : "NO";
        }
    }
}
